import React from 'react';

import './Panel.scss';

import TasksList from '../TasksList/TasksList';

interface Props {
    panelName: string;
    panelDueDate: string;
}

const Panel = (props: Props) => {
    return (
        <div className="panel">
            <div className="panel__name">{props.panelName}</div>
            <div className="panel__due-date">Due date: {props.panelDueDate}</div>
            <TasksList 
                listTitle="TODO"
                listQuantity={43}
            />
            <TasksList 
                listTitle="IN PROGRESS"
                listQuantity={10}
            />
            <TasksList 
                listTitle="DONE"
                listQuantity={50}
            />
        </div>
    );
}

export default Panel;
